    false,nt"url": null,nt"notes": "Introduction and Purpose My 1981 Wofford
    College Interim Project (independent Project #218) at Santee National Wildlife Refuge
    was proposed to give me practical f i e l d experience and to benefit personnel
    at Santee National Wildlife Refuge. Since l i t t l e was known about small mammals
    at the refuge, I undertook the task of surveying small mammals there. During January,
    1981, I was able to capture and identify some of the mammalian species that live
    on the refuge and collect some information about the relative abundance of their
    populations there.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
